总结
使用template  Method的好处，
1.可以使逻辑处理通用化，由于在父类中编写了算法，因此无需在子类中编写算法。
2.父类和子类之间的协作，在 template method模式中，子类和父类紧密联系、共同工作，因此，在子类中实现父类中声明的抽象方法时，必须要理解抽象方法被调用的时机。
